import { Component } from "react";
import axios from "axios"
import TableUser from "../components/tableuser";
import Cookies from 'universal-cookie';
import { Link } from "react-router-dom";


class UserTask extends Component {
    constructor(props) {
        super(props)
        this.state = {
            resp: []
        }
    }

    componentDidMount() {
        let config = {
            headers: {
                tokenkey: localStorage.getItem("token")
            }
        }
        axios.get(`${this.props.ip}/user`, config).then((res) => {
            console.log(res.data)
            this.setState({ resp: res.data })

        })
    }


    showall = () => this.state.resp.map((val, index) =>

        <TableUser
            sno={index + 1}
            taskname={val.taskname}
            fromTask={val.fromTask}
            toTask={val.toTask}
            completed={val.completed}
            assignedBy={val.fromAssign.username}
        />
    )

    render() {
        const cookies = new Cookies();

        return (
            <div className="container">
                <div style={{display:"flex",justifyContent:"space-between"} } className="bg-dark">
                    <h1>Hii {cookies.get('name')}</h1>
                    <Link to="/login" className="btn" style={{backgroundColor:"#FF9900"}}>Logout</Link>
                </div>

                <div style={{ margin: "0 8%", }}>
                    <div className="table bg-white " style={{ borderRadius: "10px" }}>
                        <table className="table table-hover table-responsive-sm">
                            <thead className="thead-light text-center">
                                <th>S.NO</th>
                                <th>Taskname</th>
                                <th>Start Date</th>
                                <th>End Date</th>
                                <th>Completed</th>
                                <th>Assigned By</th>
                                <th>Submit</th>
                            </thead>

                            <tbody>
                                {this.showall()}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )
    }
}

export default UserTask
